import React from "react";
import "../styles.css";
// https://coryrylan.com/blog/css-gap-space-with-flexbox
function CardItem(props) {
  return (
    <>
      <div className="cards__item">
        <div className="cards__item__link" to={props.pat}>
          {props.label} <br />
          {props.tex} <br />
          <figure>
          <img  className="pfimg" src="{props.sr}" alt="{props.sr}" /></figure>
        </div>
      </div>
    </>
  );
}

export default CardItem;
